import './List.sass';
import Search from '../search/Search';
import UpdateList from './UpdateListItem/UpdateListItem';

const List = () => {
    return(
        <div className='list'>
			<Search/>
            <table>
                <thead>
					<tr>
						<th>Ред.</th>
						<th>Опис</th>
						<th>Сума</th>
						<th>Дата</th>
						<th>Вид.</th>
					</tr>
                </thead>
                <UpdateList></UpdateList>
            </table>
        </div>      
    )
}

export default List;
